    msg = json['msg'];
    data = json['data'] != null ? Data.fromJson(json['data']) : null;
    success = json['success'];
    code = json['code'];
  }
  String? msg;
  Data? data;
  bool? success;
  num? code;
ConfigResDto copyWith({  String? msg,
  Data? data,
  bool? success,
  num? code,
}) => ConfigResDto(  msg: msg ?? this.msg,
  data: data ?? this.data,
  success: success ?? this.success,
  code: code ?? this.code,
);
