class Data {
  Data({
      this.hashtags, 
      this.interests, 
      this.languages, 
      this.tribes,});

  Data.fromJson(dynamic json) {
    if (json['hashtags'] != null) {
      hashtags = [];
      json['hashtags'].forEach((v) {
        hashtags?.add(Hashtags.fromJson(v));
      });
    }
    if (json['interests'] != null) {
      interests = [];
      json['interests'].forEach((v) {
        interests?.add(Interests.fromJson(v));
      });
    }
    if (json['languages'] != null) {
      languages = [];
      json['languages'].forEach((v) {
        languages?.add(Languages.fromJson(v));
      });
    }
    if (json['tribes'] != null) {
      tribes = [];
      json['tribes'].forEach((v) {
        tribes?.add(Tribes.fromJson(v));
      });
    }
  }
  List<Hashtags>? hashtags;
  List<Interests>? interests;
  List<Languages>? languages;
  List<Tribes>? tribes;
Data copyWith({  List<Hashtags>? hashtags,
  List<Interests>? interests,
  List<Languages>? languages,
  List<Tribes>? tribes,
}) => Data(  hashtags: hashtags ?? this.hashtags,
  interests: interests ?? this.interests,
  languages: languages ?? this.languages,
  tribes: tribes ?? this.tribes,
);
  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (hashtags != null) {
      map['hashtags'] = hashtags?.map((v) => v.toJson()).toList();
    }
    if (interests != null) {
      map['interests'] = interests?.map((v) => v.toJson()).toList();
    }
    if (languages != null) {
      map['languages'] = languages?.map((v) => v.toJson()).toList();
    }
    if (tribes != null) {
      map['tribes'] = tribes?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

